[Hookable(false)]
internal InventDim inventDim(boolean _forUpdate = false)
{
    return InventDim::find(this.InventDimId, _forUpdate);
}

[Hookable(false)]
internal InventTable inventTable(ItemId itemId = this.ItemId, boolean   _forUpdate = false)
{
    return InventTable::find(itemId, _forUpdate);
}
